    import React, { useState, useEffect } from 'react';
import { useNavigate, useHistory } from 'react-router-dom';
import axios from 'axios';
import { FormControl, FormLabel, RadioGroup, FormControlLabel, Radio, TextField } from '@mui/material';
import './loginpage.css';

function Loginpage({ closeModal }) {
  const [data, setData] = useState({ username: '', password: '' });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const navigate = useNavigate();
  const history = useHistory();

  const handleSubmit = async (event) => {
    event.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const response = await axios.post('http://127.0.0.1:8000/auth', data);
      console.log(response.data);
      setLoading(false);
      history.push('/dashboard'); // redirect to dashboard after successful login
    } catch (error) {
      console.error(error);
      setError(error.message);
      setLoading(false);
    }
  };

  const handleChange = (e, myKey) => {
    setData((prevdata) => ({ ...prevdata, [myKey]: e.target.value }));
  };

  useEffect(() => {
    console.log(data);
  }, [data]);

  return (
    <div className="ModalBackground">
      <div className="modalContainer">
        <div className="title">
          <h1>Login</h1>
        </div>
        <form onSubmit={handleSubmit}>
          <label>
            <TextField
              id="demo-helper-text-aligned"
              label="User name"
              value={data.username}
              onChange={(e) => handleChange(e, 'username')}
              helperText="Please enter your name"
              style={{ position: 'absolute', left: '40%', top: '31%', display: 'block', width: '50%' }}
              variant="outlined"
            />
          </label>
          <br />
          <label>
            <TextField
              id="demo-helper-text-aligned"
              label="Password"
              value={data.password}
              onChange={(e) => handleChange(e, 'password')}
              helperText="Please enter your password"
              style={{ position: 'absolute', left: '40%', top: '45%', display: 'block', width: '50%' }}
              variant="outlined"
            />
          </label>
          <button className="submitBtn" type="submit" disabled={loading}>
            {loading ? 'Loading...' : 'Submit'}
          </button>
        </form>
        <div className="cancelBtn">
          <button onClick={() => closeModal(false)}>cancel</button>
        </div>
        {error && <div>{error}</div>}
      </div>
    </div>
  );
}

export default Loginpage;
